				<h3>Возвращение этнографа</h3>
					Сегодня с Проксимы вернулась этнографическая экспедиция под управлением профессора Джона Голдрама из Майхартского университета. Экспедиция работала в джунглях Туманного континента и занималась изучением неконтактного племени двухвостых зюзюмов.<br />
<br />
&quot;Это племя называет себя Ракатука-Тум-Тум и крайне неохотно контактирует с пришельцами&quot;, - сказал Джон Голдрам. На вопрос о том, каковы они - неконтактные зюзюмы, профессор заявил, что неконтактные зюзюмы такие же двухвостые и скандальные как и контактные, только неконтактные.<br />
<br />
